<!DoCType html>
<html lang="en">
  <head>
    <meta charset="utf-8" />
    <title>CompressedJS Page</title>
  </head>
  <body>
    compressed code will show up here.
<div style="display:none;">
  <form id="compileForm" method="POST" action="http://closure-compiler.appspot.com/compile">
    <fieldset>
      <input type="hidden" name="compilation_level" value="SIMPLE_OPTIMIZATIONS" />
      <input type="hidden" name="output_format" value="text" />
      <input id="js_code" type="hidden" name="js_code" value="" />
      <input type="hidden" name="output_info" value="compiled_code" />
    </fieldset>
  </form>
</div>
  </body>
</html>
